package Medium;

public class SplitTwoStringsToMakePalindrome {
    private boolean judgeReverse(String str) {
        for (int i = 0; i < str.length(); i++) {
            int start = i;
            int end = str.length() - i - 1;
            if (end < start)
                break;
            if (str.charAt(start) != str.charAt(end))
                return false;
        }
        return true;
    }

    private boolean check(String a, String b) {
        int start = 0;
        while (start < a.length() && a.charAt(start) == b.charAt(b.length() - start - 1)) {
            start++;
        }
        return judgeReverse(a.substring(start, a.length() - start)) || judgeReverse(b.substring(start, b.length() - start));
    }

    public boolean checkPalindromeFormation(String a, String b) {
        return judgeReverse(a) || judgeReverse(b) || check(a, b) || check(b, a);
    }


    public static void main(String[] args) {
        SplitTwoStringsToMakePalindrome palindrome = new SplitTwoStringsToMakePalindrome();
        String a = "";
        String b = "";
        System.out.println(a.length());
        System.out.println(palindrome.checkPalindromeFormation(a, b));
    }
}
